import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Application } from "react-rainbow-components";
const theme = {
  rainbow: {
    palette: {
      brand: "86c9ef",
      mainBackground: "#ffffff"
    }
  }
};
ReactDOM.render(
  <Application theme={theme}>
    <App />
  </Application>, document.getElementById('root'));
